//Get total number of record in XML file
def Result = context.expand( '${ISPCAssertion#ResponseAsXml#//Results[1]}' )
log.info 'DB Result : '+Result;

def bodyNode = new XmlSlurper().parseText(Result)
def count = bodyNode.ResultSet.Row.TRANSACTIONSID.size();
log.info 'Total Number of records in XML : '+count;

for (def x=1;x<=count;x++)
{
def E2EID = context.expand( '${ISPCAssertion#ResponseAsXml#//Results[1]/ResultSet[1]/Row['+x+']/ENDTOENDID[1]}' )
//log.info 'ENDtoENDID is : '+ENDTOENDID;
//
//def E2EID = ENDTOENDID.substring(23);
log.info E2EID+' Verification';;
	switch(E2EID)
	{
		case ~/.*P1.T1/:

			def PAYMENTTYPE = context.expand( '${ISPCAssertion#ResponseAsXml#//Results[1]/ResultSet[1]/Row['+x+']/PAYMENTTYPE[1]}' )
